import React from 'react';
import s from './Avatar.module.css';

const Avatar = (props) => {
    return (
        <div>
            <div className={s.avatar}>
                <img src="http://img1.reactor.cc/pics/post/full/anon-%D0%9A%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%BA%D0%B0-2191131.jpeg"/>
            </div>
            <div>{props.state.name}</div>
        </div>
    )
}

export default Avatar;
